import React, { Component } from 'react';
import {Card, CardBody, CardImg} from 'reactstrap';

class Content extends Component{
	constructor(props) {
		super(props);
		this.state = {}
    }

    componentDidMount(){
        console.log("hola mundo");
    }

	render(){
		const pos = {img:"12"}
		return(
			<Card className="product">
				<CardBody>
					<Col xs={pos.img} sm={pos.img} md={pos.img} className="logo" className="separation">
						<a href='/'>
							<div className="contImg">
								<CardImg src="https://http2.mlstatic.com/reloj-led-colores-D_NQ_NP_851720-MCO31042477337_062019-V.webp"/>
							</div>
						</a>
					</Col>
				</CardBody>
				<CardBody>
					<div className="separation">
						Content
					</div>
				</CardBody>
				<CardBody>
					<div className="separation">
						Content
					</div>
				</CardBody>
			</Card>
		)	
	}
}

export default Content;
